column8:
　男の子に大人気のブランド！PUMAからお財布を入荷しました！<br>
シンプルなのに機能性抜群だからスタイリッシュに使えます☆<br>
<br>
コンパクトに持ち運べる二つ折り財布は<br>
カバンやポケットに入れやすいところが◎！<br>
中身を落としにくいラウンドファスナータイプなのも嬉しいです☆<br>
コイルチェーンをベルト通しに引っ掛けて使ってね！<br>
<br>
【カラーバリエーション】<br>
・ブラック<br>
・ブルー<br>
<br>
【仕様】<br>
・札入れ×2<br>
・カード入れ×5<br>
・コイン入れ×1<br>
・コイルチェーン付<br>
<br>
【サイズ】<br>
約W135×H95×D25ｍｍ（チェーン含まず）<br>
<br>
【材質】<br>
合成皮革（PU）、ナイロン<br>
<br>
※スタッフ採寸の為、サイズが多少異なる場合がございます。予めご了承ください。<br>
※お使いの画面環境により画像の色味に多少の差異が生じます。予めご了承ください。<br><style type="text/css">

a:hover img{filter: alpha(opacity=75);
-moz-opacity:0.75;
opacity:0.75;
}



/* キャラクターボタン */

#cbtn_box ul li a:hover img{
	border:2px solid #f2c343;
}



#cbtn_box{
	width:710px;
	margin:0px;
	padding:0px;
	overflow:hidden;
	}


#cbtn_box ul{
	width:710px;
	margin:0px;
	padding:0px 5px;
	list-style:none;
	display:block;
	height:125px;
	overflow:hidden;
	}


#cbtn_box ul li{
	float:left;
	width:139px;
	height:120px;
	padding:2px 0px;
	}

.b-dotted-l{
	border-left:1px dotted #e2e2e2;	
	}

.b-dotted-r{
border-right:1px dotted #e2e2e2;	
	}

.b-dotted-b{
border-bottom:1px dotted #e2e2e2;
}

.mr2{
	margin-right:2px;
	}

.dis-none{
	display:none;
	}


#cbtn_box660 a:hover img{
	filter: alpha(opacity=75);
	-moz-opacity:0.75;
	opacity:0.75;
	border:2px solid #f2c343;
}

#cbtn_box660{
	width:660px;
	margin:0px;
	padding:0px;
	overflow:hidden;
	margin-bottom:70px;
	}


#cbtn_box660 ul{
	width:660px;
	margin:0px;
	padding:0px 0px;
	list-style:none;
	display:block;
	height:100%;
	overflow:hidden;
	}


#cbtn_box660 ul li{
	float:left;
	width:138px;
	height:120px;
	padding:2px 12px;
	}

.b-dotted-l{
	border-left:1px dotted #d2d2d2;	
	}

.b-dotted-r{
border-right:1px dotted #d2d2d2;	
	}

.b-dotted-b{
border-bottom:1px dotted #d2d2d2;
}

.dis-none{

	display:none;
	}


.ctitle{
	font-size:10pt;
	font-weight:bold;
	background-color:#e2e2e2;
	border:1px solid #CCC;
	padding:10px;
	width:638px;
	margin-bottom:5px;
	}

.mb10{margin-bottom:10px;}
.mb15{margin-bottom:15px;}

</style>
</head>

